import React from "react";
import ReactDOM from "react-dom";
import Bardcodetextfield from "./BarcodeTextField.js";

import "./styles.css";

function App() {
  return (
    <div className="App">
      <div id="scanner-container" />
      <div>
        <p style={{ display: "inline-block" }}>Barcode: </p>
        <Bardcodetextfield style={{ display: "inline-block" }} />
      </div>
    </div>
  );
}

<body onload="getAPIdata()">

<strong>Barcode Number: </strong> <div id="BarcodeNumber"></div><br/>

<strong>Product Name: </strong> <div id="ProductName"></div><br/>

<strong>Entire Response: </strong>

<div id="EntireResponse"></div>

  </body>

const rootElement = document.getElementById("root");
